import React, { useEffect } from "react";

const App = () => {
  useEffect(() => {
    let data = [
      {
        nom: "Moussa",
        prenom: "Mahmoud",
        age: 31,
        months: "May"
      },

      {
        nom: "Mssa",
        prenom: "MooinaHamida",
        age: 33,
        months: "Août"
      }
    ];

    console.log(data.length);
  });
  return <></>;
};

export default App;
